import { StatusBar } from 'expo-status-bar';
import { ImageBackground, StyleSheet, Text, View , Image} from 'react-native';
import Page1text from '../components/page1text';
import SushiClub from '../components/SushiClub';



const Tutorial1 = ()=>{
    return(

        <ImageBackground style={{height:'100%', position:'relative'}} blurRadius={2} source={require('../img/sushiBack.jpg')}>
            <View style={{width:'100%', height:'100%',position:'absolute', backgroundColor:'black', opacity:0.7}}></View>

            <SushiClub/>
            <Page1text height={'50%'} width={'100%'}/>
            <Image source={require('../img/bottoneSushi.png')} style={{width:'100%',height:200, resizeMode:'contain'}} />


        </ImageBackground>

    );
}


export default Tutorial1;
